Selecionando programadores para manter em sua base de dados para realização de demandas em sistema de gestão empresarial e novos projetos. 
Habilidades necessárias
- Novas praticas desenvolvimento com novas tecnologias em Delphi;
- Banco de Dado FB 2.5 e 3.0;
- Capacidade para Resolver Problemas;
-... Ver mais detalhes  Conhecimento nos componentes: 
* acbr:NF-e, Sped Fiscal, Boleto e outros;
* jcl master, jvcl master, devexpress, forte report, zip master e firedarc;
- Agilidade na programação; 
os programadores que for selecionados devem:
- ter comprometimento com o projeto;
- concluir as tarefas que foi passado;
- ativar o cronometro da tarefa apenas quando estiver trabalhando e para o cronometro quando parar de trabalhar. 
Nosso comprometimento é fornecer o ambiente de desenvolvimento funcional e todas as informações necessárias para realização das tarefas e realizar os pagamentos do valor total todo dia 30 de cada mês correspondente as horas de trabalho. 
Valor da hora inicial para 2 primeiras tarefas são de R$ 20,00 reais, após o valor é R$ 30,00 a hora,
Programadores que tem melhor resultado em concluir as tarefas e entregar dentro do prazo tem prioridade em receber novas demandas e reajuste no preço da hora de desenvolvimento.  
Obs: Em 2019 passou mais de 10 programadores e restou apenas 1, os outros 9 não demonstrou comprometimento com o trabalho, não tinha conhecimento necessário, deixou o cronometro ativado mesmo não trabalhando ou teve seu desempenho comprometido no decorrer dos trabalhos. 
Não precisa anexar curriculum.Categoria: TI e ProgramaçãoSubcategoria: ProgramaçãoIsso é um projeto ou uma posição de trabalho?: Um projetoTenho, atualmente: Eu tenho especificaçõesDisponibilidade requerida: Meio períodoFunções necessárias: Desenvolvedor colapsar

