Preciso de plataforma web que:
1. Permita a validação biométrica facial do professor e dos alunos, na abertura e no término da aula;
2. Permita o monitoramento da permanência do professor e alunos na sala virtual, durante a realização das aulas;
3. 
Ter a capacidade de verificar, por meio do... Ver mais detalhes  cruzamento das informações colhidas pela plataforma utilizada e as bases de dados dos órgãos responsáveis a autenticidade biométrica facial do instrutor e dos candidatos;
4. Possuir ferramenta de auditoria do acesso e das ações de cada usuário no sistema, incluindo endereço IP utilizado pelo usuário;
5. Disponibilizar interface para usuários, que permita que o professor compartilhe, em tempo real, seu vídeo, seu áudio e a tela do seu dispositivo, e que o aluno visualize suas aulas agendadas;
6. 
Permitir que a interação em tempo real entre o aluno e professor ocorra por meio de vídeo ou por meio de chat;
7. Permitir o registro de cada aula, agrupando os dados, gerando relatórios com informações suficientes para o controle da carga horária, frequência do aluno e professor;
8. Não permitir a manipulação das informações coletadas durante as aulas, sendo permitida apenas sua visualização;
10. 
Permitir o registro de cada aula gerando relatórios gerenciais com, pelo menos, as seguintes informações: 
a) identificação da turma;
b) data e horários de início e de término da aula;
c) conteúdo programático da aula agendada;
d) horário de início da aula, com o devido registro biométrico facial do professor;
e) quantidade de alunos com presença registrada na sala virtual;
f) horário de entrada de cada aluno, com seu respectivo registro biométrico facial;
g) dados de validação aleatória (candidatos sorteados, com registro biométrico facial e horário da validação);
h) horário de saída de cada aluno, com seu respectivo registro biométrico facial; e
i) horário do término da aula, com o devido registro biométrico facial do professor.Categoria: TI e ProgramaçãoSubcategoria: ProgramaçãoQual é o alcance do projeto?: Criar um novo site personalizadoIsso é um projeto ou uma posição de trabalho?: Um projetoTenho, atualmente: Eu tenho especificaçõesDisponibilidade requerida: Conforme necessárioIntegrações de API: Outros (Outras APIs)Funções necessárias: Desenvolvedor colapsar

