Preciso de um sistema de leitura e gravação de TAG´s com tecnologia RFid, deverá ser desenvolvido considerando que  os coletores terão sistema Android e os portais terão sistema web, podendo ser java ou asp, segue as funcionalidades do sistema: 
1)software mobile: - equipamento  (celular... Ver mais detalhes  com android versões acima de 7)
- leitura e gravação de tag´s uhf utilizando leitor manual;
- leituras em lote, armazenando dados lidos;
- geração de relatório em xls, txt, csv ou pdf;
- possibilidade de trabalhar online e offline;
- exportar resultados pelo wifi quando online;
- possibilidade de busca de tag especifica;
- utilização de senha para gravação (proteção tag);
- sistema de gravação de número de tag com entrada de número ou busca em - local especifico (planilha excel);
- telas intuitivas e de fácil utilização;
- possibilidade de alteração de potência;
- alertas sonoro; 
2) portal de leitura (almoxarifado) - java ou asp ( equipamento: leitor uhf izar 4 portas tnc br )
leitura com leitor fixo;
- de acordo com as varrições da potência, identificar entrada ou saída;
- gerar relatório exportável com data, hora, usuário e itens do estoque, tanto entrada como saída;
- relatórios em xls, txt, csv ou pdf;
- leituras em lote, armazenando dados lidos;
- identificação dos tag´s por tipo, por exemplo, crachá, item do almoxarifado, cesta de transporte;
- possibilidade de se alterar a potencia 
3) portal (veículos); java ou aps (equipamento: leitor uhf acura edge50 autoid bn v)
- leitura com leitor fixo;
- identificar leituras de acordo com a antena;
- de acordo com a antena lida, identificar entrada ou saída;
- gerar relatório exportável com data, hora e veiculo, tanto entrada como saída;
- relatórios em xls, txt, csv ou pdf;
- possibilidade de se alterar potencia  
todos os equipamentos possuem api´s disponibilizadas pelo fabricante, os desenvolvimentos deverão ser realizados no período de 45 dias, com iteração constante entre desenvolvedor e contratante. 
