Principais Recursos 
MODELO: Sistema de gestao para empresas de fornecimento de internet.  
Cadastro de clientes;
•    Serviços eventuais e periódicos;
•    Gestão de valores, descontos e ferramentas de gestão de promoções;
•    Geração de boletos e carnês em PDF, com... Ver mais detalhes  opção para impressão frente-verso;
•    Rotinas personalizadas com bloqueio/desbloqueio automático;
•    Gerenciamento de conexões PPPoE, Hotspot e ip+mac; (radius)
•    integração com olt fiberhome/huawei via tl1;
•    suporte à novas integrações;
•    agrupamento de contratos;
•    envio de e-mails e sms para clientes com mensagens de boas-vindas, bloqueio e inadimplência e etc;
•    ordens de serviço (para usuários e grupos);
•    backup automático e envio por e-mail e ftp;
•    preenchimento automático dos termos contratuais (pdf e html);
•    monitoramento da infraestrutura (smnp, ping e etc);
•    níveis personalizados de acesso ao sistema por usuário e grupo;
•    histórico de conexão de clientes (tráfego, horário, ip, mac e etc);
•    protocolo de atendimento;
•    controle de devices (equipamentos), onde você pode cadastrar equipamentos e vincular as portas do mesmo ao contrato;
•  
clientes
completo cadastro de clientes, fornecedores, funcionários, terceiros e agentes autorizados.
Ilimitada opções de cadastros de endereços, permitindo vários endereços por cada cliente, sendo assim possível direcionar a cobrança ao destinatário correto sendo ele o destinatário do serviço prestado ou apenas o mantenedor, com opção de cobrança agrupada ou não de suas faturas. 
Serviços / Contratos
Gerencia o cadastro de serviços e suas diversas periodicidades (configuráveis), sendo elas: eventual, mensal, bimestral, trimestral e etc., Voltado tanto para ordens de serviços quanto contratos periódicos.
Gestão de valores, descontos, vencimentos, parametrizados/restrito e opcional, com ferramentas gestão de promoções.
Suporte a cobrança via carnê de 2 até 32 parcelas.    
Gerencia múltiplas tabelas de preços, agendadas ou não.
Permite parametrização ILIMITADA do serviço para atender a necessidade real, executando rotinas de configuração/cancelamento (programado ou não), bloqueio/desbloqueio automático no ato de integração com um ou mais sistemas diversos.
Diariamente são enviados automaticamente relatórios sobre os bloqueios, desbloqueios e cancelamento executados.    
Agendamento de bloqueios para fins de negociação.
Agrupamento de contratos de forma customizada (scm e sva).
Preenchimento automática dos termos contratuais cliente-empresa, de acordo com o modelo disponibilizado pela empresa.     
Central do Assinante (web/app)
Com objetivo de solução de problemas e redução de suporte telefônico e presencial, central do assinante completa, totalmente parametrizada de acordo com a necessidade da empresa oferecendo: 
•    Histórico financeiro do cliente;
•    2ª via de boletos atualizados (com multa e juros);
•    Confirmação de pagamento on-line (para liberação imediata do serviço do cliente);
•    Pagamento on-line através de gateways de pagamento (api bancos);
•    Histórico de ordens de serviço;
•    Suporte on-line do cliente com a empresa;
•    Atualização de dados cadastrais do cliente;
•    Mural de avisos (empresa para cliente);
•    Alteração de senhas;
•    Extrato de ligações para plataformas de telefonia;
•    Relatório de Utilização;
•    Declaração de quitação anual; 
Gerenciador Financeiro
Geração de boletos bancários para todos os bancos nacionais, com geração em massa ou individual, com opção para utilização de quantas contas a empresa achar necessário. 
Geração de arquivos de remessa para o banco (em caso de cobrança registrada ou débito em conta).
Processamento de arquivos de retornos disponibilizados diariamente pelo banco para baixa automática de títulos.
Relatórios personalizados, incluindo gráficos.     
Ferramentas de Cobrança para redução de inadimplência, com várias forma de cobrança e diversos avisos (totalmente pametrizados e personalizados) que sua empresa possa emitir ao cliente, tais como:
•    Boletos personalizados com nota fiscal na mesma folha ou verso;
•    Cobrança sem registro, registrada, débito em conta e cartão de crédito;
•    Processamento de arquivos de retorno;
•    Relatórios personalizados (gráficos, Excel e Google Maps);
•    Ferramentas de cobrança (E-mails, SMS, telas de aviso em PPPoE e Hotspot, push no app); (mikrotik/ubiquiti/cisco)
•    nota fiscal eletrônica (2ª via eletrônica) modelo 21 e 22;
•    cobrança de mensalidade via cartões de crédito; 
de acordo com a necessidade do cliente, seja ela uma venda extra-sistema, ou uma negociação diversa, é possível gerar boletos eventuais, com qualquer nome/descrição que o serviço prestado possa ter, independente da quantidade de parcelas e valores a sua escolha, atendendo a necessidade do cliente e a forma de pagamento da empresa, seja ela de forma individual (sem vinculo ao contrato – corte automático) e de forma vinculada a parcela mensal cobrada pelo contrato (com vínculo de corte automático). 
F2B, Gerencia NET, PagSeguro 
Comissão a Terceiros
Caso necessite repassar comissão a terceiros, o sistema permite administrar prestadores de serviço (terceiros e agentes autorizados) e suas subcontratadas (vendedores por exemplo), gerando inclusive a árvore de subcontratação vedado com permissões de acesso. 
•    Cálculo automático de comissões via faturamento ou recebimento de títulos;
•    Pagamento de comissão somente para títulos (configurado);
•    Permite cálculo de comissão sobre valores renegociados;
•    Vários relatórios para acompanhamento e pagamento de comissão;
•    Comissão para serviços periódicos (contratos) e eventuais (ordem de serviço);
•   
Nota Fiscal Eletrônica (2ª Via Eletrônica) modelo 21 e 22
Totalmente automático, o sistema homologado e gerando a nota fiscal modelo 21 e 22. 
Layouts desenvolvidos, mas o que mais de destaca é a "Nota Fiscal/Fatura" (nota fiscal agregada ao boleto).
Dentre as principais formas de geração de nota fiscal, totalmente parametrizada, é possível gerar a nota fiscal no ato da geração da fatura-boleto ou no ato da quitação, muito utilizado para empresas que trabalham com carnês. 
Mensagens Automáticas
Histórico completo de e-mails enviados ao cliente, seja ele emissão de boletos impressos, via e-mail ou cobranças diversas, tudo isso vinculado à ficha do cliente, gerando relatórios de acompanhamento periódico com confirmação de leitura dos mesmos. 
Ordens de Serviços
Abertura e acompanhamento de ordens de serviços, para atendimento de chamados de suporte ou garantia junto aos seus clientes, disponível acesso e acompanhamento via central do assinante.
Com funcionamento baseado no modelo de “Workflow” (traduz-se literalmente por “fluxos de trabalho”), onde o chamado/ordem de serviço pode ser manipulado por vários grupos de funcionários até que seja finalizado.
Notifica via e-mail o funcionário ou o grupo responsável no ato de abertura ou encaminhamento da ordem de serviço e o cliente com a solução do problema.    
Relatórios e gráficos diversos por tipo de serviço, grupo de atendimento, atendente, tempo médio de fechamento etc.
Notificação via e-mail e SMS para o funcionário ou grupo responsável no ato de abertura ou encaminhamento da ordem de serviço e ao cliente com a conclusão do atendimento. 
Níveis e Log de Acesso
Seus acessos (operacionais) são totalmente configuráveis de acordo com as permissões dispostas para cada usuario/grupo de usuário.
Todas as ações do usuário sobre o sistema são monitoradas, onde é armazenado quem e quando criou e editou os registros, alem de restringir ou não o acesso por usuário em maquinas especificas nos horários pré-determinados a rede de trabalho. 
Backup Automático
Possuir uma ferramenta própria de backup, que pode ser executada até 24 vezes ao dia, salva em um servidor de FTP fornecido por sua empresa ou alocado em outra estrutura. 
HelpDesk (Tickets ou Chamados)
Abertura e acompanhamento de chamados de suporte ou dúvidas junto aos colaboradores (funcionários) da empresa. Funciona baseado no modelo de Workflow, onde o chamado pode ser manipulado por várias pessoas até que seja finalizado.
Notifica por e-mail o "usuário solicitante", com a posicionamento/solução do problema.     
Atualizações/Novidades/Personalizações
Mensalmente serão lançadas novas versões do sistema e disponibilizadas para os clientes. Cada nova versão sempre vem acompanhada de novos recursos. 
