O programa seguirá os seguintes passos:
1) O usuário entra o nome de cada matéria;
2) A seguir abre-se uma janela com duas opções:
2.1) Material escrito: quantidade de páginas;
2.1.1) Tempo para ler uma página (default: 3 minutos)
2.2) Material em vídeo: quantidade de aulas;
2.2.2) Média de tempo... Ver mais detalhes  dos vídeos (default: 30 minutos)
3) Com os dados referentes a todas as disciplinas, o programa calcula o tempo proporcional de cada disciplina em relação ao todo;
4) O usuário entra com a quantidade de horas de teoria por semana (opões: 20 horas, 30 horas, 40 horas);
5) Com base na informação da proporção do item 3 o sistema calcula (com intervalos de meia em meia hora) o tempo semanal de cada disciplina;
6) Por fim gera um planejamento em PDF próximo do arquivo que está anexado a este projeto. 
Observação: no processo de arredondamento será acrescida meia hora no menor valor (até se chegar a quantidade de horas total, ou será retirada meia hora do maior valor (até chegar a quantidade total de horas). 
No final está anexado um arquivo de saída com o que se espera chegar ao rodar o programa.Categoria: TI e ProgramaçãoSubcategoria: ProgramaçãoQual é o alcance do projeto?: Alteração médiaIsso é um projeto ou uma posição de trabalho?: Um projetoTenho, atualmente: Eu tenho uma ideia geralDisponibilidade requerida: Conforme necessárioFunções necessárias: Desenvolvedor, Designer colapsar

