O objetivo deste projeto é a criação de um módulo de conferência/separação de pedidos por código de barras que elimine erros na separação dos pedidos. O sistema deverá ser integrável ao nosso ERP. O funcionamento seria da seguinte maneira: O módulo de conferência pega os dados do pedido em um banco... Ver mais detalhes  sql (Dados do cliente, número do pedido, ítens, quantidades e nomes dos produtos do pedidos), um operador realiza a conferência via código de barras, e ao finalizar o módulo dá entrada em uma observação no pedido dizendo que o pedido foi separado com sucesso no campo observação do bd do ERP. 
Funções que o módulo deve ter:
• Conferência total do pedido;
• Conferência por código de Barras;
• Saiba quem separou o pedido;
• Impressão de etiquetas para caixa;
• Múltiplos funcionários conferindo pedidos;
• Conferência parcial do item;
• Fotos para rápida identificação; 
